import React from 'react';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';
import AOS from 'aos';
import 'aos/dist/aos.css';

const Carousel = () => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
  };

  return (
    <Slider {...settings}>
      <div>
   <h1>hey</h1>
      </div>
      <div>
       <h2>hey</h2>
       <br></br>
       <div data-aos="fade-up">
       <h2>this is me </h2>
       </div>

      </div>
      <div>
       <h2>hey</h2>
      </div>
      <div>
       <h2>hey</h2>
      </div>
      <div>
       <h2>hey</h2>
      </div>

    </Slider>
  );
};

export default Carousel;
